import React from "react";
import { Container, Grid, Paper, Typography } from "@mui/material";
import Header from "../components/Header";  // ✅ Only Home uses Header

const categories = [
  { title: "General Aptitude", items: ["Arithmetic Aptitude", "Data Interpretation", "Online Tests"] },
  { title: "Interview", items: ["Placement Papers", "Group Discussion", "HR Interview"] },
  { title: "Engineering", items: ["Mechanical", "Civil", "CSE", "EEE"] },
  { title: "Programming", items: ["C", "C++", "Java", "Python"] },
];

const Home = () => {
  return (
    <>
      {/* ✅ Header is ONLY here */}
      <Header />
      <Container sx={{ mt: 3 }}>
        <Typography variant="h4" sx={{ mb: 2, color: "orange" }}>
          Welcome to AptitudeArc!
        </Typography>
        <Grid container spacing={3}>
          {categories.map((category, index) => (
            <Grid item xs={12} md={6} lg={4} key={index}>
              <Paper sx={{ padding: 2, backgroundColor: "#fff8e1" }}>
                <Typography variant="h6" sx={{ color: "orange" }}>{category.title}</Typography>
                <ul>
                  {category.items.map((item, i) => (
                    <li key={i}>{item}</li>
                  ))}
                </ul>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </>
  );
};

export default Home;
